import React, { useState, useEffect } from 'react';
import { useSearchParams } from 'react-router-dom';
import Card from "react-bootstrap/Card";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Nav from 'react-bootstrap/Nav';
import Tab from 'react-bootstrap/Tab';
import './Result.css';
import Search from './search';
import logo from './travel-made-easy.svg';

const Result = (prop) => {
    var DatePicker = require("react-bootstrap-date-picker");
    const [searchParams] = useSearchParams();
    const [data, setData] = useState(null);
    const [searchQuery, setSearchQuery] = useState(searchParams.get('place_name') || '');
    useEffect(() => {
        fetch("http://localhost:8000/places?=" + searchParams.get('place_name'))
            .then(response => response.json())
            .then(setData);
    }, [searchParams]);

    if (data != null && data[0]) {
        return (

            <div className="result">
                <Row>
                    <Col sm={1}>
                        <div className="result-logo">
                            <a href="/">
                                <img src={logo} className="App-logo" alt="logo" />
                            </a>
                        </div>
                    </Col>
                    <Col sm={5}>
                        <div className="App-search">
                            <Search
                                searchQuery={searchQuery}
                                setSearchQuery={setSearchQuery}
                            />
                        </div>
                    </Col>
                    <Col sm={3}>
                        <FormGroup>
                            <ControlLabel>Label</ControlLabel>
                            <DatePicker id="from-datepicker" value={this.state.value} onChange={this.handleChange} />
                            <HelpBlock>Help</HelpBlock>
                        </FormGroup>;
                    </Col>
                    <Col sm={3}>

                    </Col>
                </Row>
                <div className="result-header">
                    <Row>
                        <Col sm={12}>
                            <Card>
                                <Card.Body>
                                    <Card.Title className="title">{data[0].place_name}</Card.Title>
                                    {/* <Card.Text>{data[0].summary}</Card.Text> */}
                                </Card.Body>
                            </Card>
                        </Col>
                    </Row>
                </div>
                <div className="result-tab">
                    <Row>
                        <Col sm={12}>
                            <Tab.Container justify fill id="left-tabs-example" defaultActiveKey="first">
                                <Row>
                                    <Col sm={3}>
                                        <Nav variant="pills" className="flex-column">
                                            <Nav.Item>
                                                <Nav.Link eventKey="first">Any food places nearby?</Nav.Link>
                                            </Nav.Item>
                                            <Nav.Item>
                                                <Nav.Link eventKey="second">Is it safe?</Nav.Link>
                                            </Nav.Item>
                                        </Nav>
                                    </Col>
                                    <Col sm={9}>
                                        <Tab.Content>
                                            <Tab.Pane eventKey="first">
                                                {data[0].food_places.map((review) => (
                                                    <Card>
                                                        <Card.Body>
                                                            <Card.Title>{review.reviewer}</Card.Title>
                                                            <Card.Text>{review.review_comment}</Card.Text>
                                                        </Card.Body>
                                                    </Card>
                                                ))}
                                            </Tab.Pane>
                                            <Tab.Pane eventKey="second">
                                                {data[0].is_it_safe.map((review) => (
                                                    <Card>
                                                        <Card.Body>
                                                            <Card.Title>{review.reviewer}</Card.Title>
                                                            <Card.Text>{review.review_comment}</Card.Text>
                                                        </Card.Body>
                                                    </Card>
                                                ))}
                                            </Tab.Pane>
                                        </Tab.Content>
                                    </Col>
                                </Row>
                            </Tab.Container>
                        </Col>
                    </Row>
                </div>
            </div>

        );
    } else {
        return (
            <div />
        );
    }
};

export default Result;
